import React from "react";

function CursusItem({image, name, price }) {
  return (
    <div className="CursusItem">
      <div style={{ backgroundImage: `url(${image})` }}> </div>
      <h1> {name} </h1>
      <p> ${price} </p>
    </div>
  );
}

export default CursusItem;
